import React from 'react';
import { Layout, Menu } from 'antd';
import { PieChartOutlined, UserOutlined, TeamOutlined, FileOutlined } from '@ant-design/icons';

const { Header } = Layout;
const { SubMenu } = Menu;

const AppHeader = () => {
  return (
    <Header className="header">
      <div className="logo" />
      <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']} className="menu">
        <Menu.Item key="1" icon={<PieChartOutlined />}>
          Dashboard
        </Menu.Item>
        <SubMenu key="sub1" icon={<UserOutlined />} title="Courses">
          <Menu.Item key="2">Course 1</Menu.Item>
          <Menu.Item key="3">Course 2</Menu.Item>
        </SubMenu>
        <SubMenu key="sub2" icon={<TeamOutlined />} title="Instructors">
          <Menu.Item key="4">Instructor 1</Menu.Item>
          <Menu.Item key="5">Instructor 2</Menu.Item>
        </SubMenu>
        <Menu.Item key="6" icon={<FileOutlined />}>
          Contact
        </Menu.Item>
      </Menu>
    </Header>
  );
};

export default AppHeader;
